import './landing.css';
import imgLanding from '../../img/landing.jpg';

var sectionStyle = {
    width: "100%",
    height: "610px",
    backgroundImage:  `url(${imgLanding}` 
  };

export function Landing() {
    return (
     <div>
         <section style={sectionStyle} >
             <div className='titles'>
                 <h1 className='title'>Bienvenidos!</h1>
                 <h2>Welcome!</h2>
                 <h3>Bem-Vindo!</h3>
                 <h4>Benvenuto!</h4>
                 <h5>Willkommen!</h5>
             </div>

             <button className='button' onClick={() => {}} >Ingresar</button>

         </section>
     </div>
    )
};

export default Landing
